    Annual narrative report: Calendar year 1992",nt"tracking_summary": {ntt"total":
    2,ntt"recent": 2nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-07-27T22:57:11.130432",nt"name": "long-lake-national-wildlife-refuge-and-long-lake-wetland-management-district-annual-narrat-d9543",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Long Lake
    NWR, Long Lake WMD, Slade NWR, Florence Lake NWR, and the easement refuges outlines
    Refuge accomplishments during the 1992 calendar year. The report begins with a summary
    of the year's highlights and weather conditions. Land acquisition is covered. The
    report includes a planning section which discusses management planning, public participation,
    and research and investigations. Refuge administration is outlined; information
    about personnel, volunteer programs, funding, safety, and technical assistance is
    given. Habitat management is also covered; subjects include wetlands, forests, croplands,
    grasslands, grazing, haying, fire management, pest control, water rights, and WPA
    easements. The wildlife section of the report discusses wildlife diversity, endangered
    and threatened species, waterfowl, marsh birds and waterbirds, shorebirds, raptors,
    game mammals, fisheries resources, wildlife propagation, animal control, marking
    and bird banding, and disease control. The public uses of the Refuge described in
    this report include outdoor classrooms, interpretive programs, hunting, fishing,
    trapping, wildlife observation, outdoor recreation, and law enforcement. The equipment
    and facilities section of the report provides information about new construction,
    rehabilitation, major maintenance, and equipment replacement. Cooperative programs
    are provided at the end. Refuge brochures, newspaper articles, and field guides
    are attached.",nt"license_title": "License Not Specified",nt"extras":
